import RegisterPage from './RegisterPage'

function LoginPage() {
    return (
        <div>
            <h1>Login</h1>

                Username: <input type={"name"} name={"Username"}/>
            <br/>
                Password: <input type={"password"} name={"Password"}/>
            <br/>

            <button>Login</button>
            <br/>
            <button onClick={RegisterPage}> Register</button>
        </div>
    );
}

export default LoginPage
